import React from "react";
import CoffeCard from "./CoffeCard";
import { Grid } from "@material-ui/core";

const Content = () => {
  return (
    <Grid container spacing={2}>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
      <Grid item xs={4}>
        <CoffeCard />
      </Grid>
    </Grid>
  );
};

export default Content;
